import React, { useEffect, useState } from 'react';
import CardComponent from './CardComponent';

function App() {
  const [flights, setFlights] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000/flights') // Adjust the URL to your JSON server
      .then(response => response.json())
      .then(data => setFlights(data))
      .catch(error => console.error('Error fetching flights:', error));
  }, []);

  return (
    <div style={{ backgroundColor: '#212529', minHeight: '100vh', display: 'flex', flexWrap: 'wrap', justifyContent: 'center', alignItems: 'center', padding: '20px' }}>
      {flights.map(flight => (
        <CardComponent key={flight.id} flight={flight} />
      ))}
    </div>
  );
}

export default App;
